  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains delinquency and criminal
  referrals of Oregon youth to county juvenile departments between 2008 and 2010.
  Referrals in the juvenile justice system are analogous to arrests in the adult system.
  Each row in this dataset represents a unique referral and includes demographic information
  about the referred youth. Youth may be referred multiple times; hence, some youth
  are associated with multiple referrals in this data set.    For more information
  please go to:  http://www.oregon.gov/OYA/jjis_data_eval\",\n\t\"license_title\":
